    clarification of the apparent discrepancy between the Itemized and Unitemized
    Calendar Year-to-Date totals on lines 11(a)(i) and 11(a)(ii), Column B, of the
    prior report filed March 23, 2008. Due to a vendor software change, the committee
    failed to properly format the report to correctly report the Itemized and Unitemized
    contributions, although the total contributions on line 11(a)(iii) was in fact
    correct. As submitted, the report provided greater itemization detail than required.
    With this report, the figures shown on lines 11(a)(i) and 11(a)(ii) have been
